import React  from 'react';
import '../Cards.css';
import PicItem from '../PicItem';

export default function Paintings() {
  return (
    <>
    <div className='cards'>
      <h1>My Projects</h1>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <PicItem src='images/img-7.jpg'/>
          </ul>
        </div>
      </div>
    </div>
    </>
  );
}
